CREATE TABLE estaciones (
  "id" int NOT NULL,
  "estacion" varchar NOT NULL,
  "nombre" varchar,
  "ubicacion" varchar,
  "desde" date,
  "hasta" date,
  "fuente" varchar,
  "longitud" numeric,
  "latitud" numeric,
  PRIMARY KEY ("id")
);




CREATE TABLE mediciones (
  "id" int NOT NULL,
  "estacion" varchar NOT NULL,
  "fecha" date,
  "tmax" numeric,
  "tmin" numeric,
  "tmedia" numeric,
  "pp_mm" numeric,
  "heliofania" numeric,
  "viento_max_direccion" numeric,
  "viento_max_intensidad" numeric,
  "viento_medi" numeric,
  "temp_rocio_media" numeric,
  "presion_nivel_estacion" numeric,
  "humedad_relativa" numeric,
  "cant_datos_promedio" numeric,
  PRIMARY KEY ("id")
);


